import React from "react";
import Hamburger from "./Hamburger";

const Navbar = () => {
  return (
    <div className="navbar">
      <Hamburger />
      <nav>
        <ul>
          <li>logowanie</li>
          <li>rejestracja</li>
        </ul>
      </nav>
      <style jsx>
        {`
          .navbar {
            display: flex;
            justify-content: flex-end;
            height: 40px;
          }

          .hamburger {
            position: absolute;
            z-index: 30;
          }

          nav {
            position: fixed;
            z-index: 20;
            right: 0;
            top: 0;
            padding: 30px;
            background: rgba(0, 0, 0, 0.7);
            color: white;
            padding-top: 20px;
            width: 100%;
          }

          ul {
            list-style-type: none;
          }
        `}
      </style>
    </div>
  );
};

export default Navbar;
